import React from "react";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <>
      <footer class="text-center text-lg-start bg-white text-muted fixed-bottom">
        {/* Section: Links  */}
        <section className="">
          <div class="container text-center text-md-start mt-5">
            {/* Grid row  */}
            <div class="row mt-3">
              {/* Grid column  */}
              <div class="col-md-3 col-lg-4 col-xl-3 mx-auto mb-4">
                {/* Content  */}
                <h3 class="text-uppercase fw-bold mb-4">LOCATION</h3>
                <p>2215 John Daniel Drive</p>
                <p>Clark, MO 65243</p>
              </div>

              {/* Middle */}
              <div class="col-md-2 col-lg-2 col-xl-2 mx-auto mb-4 ">
                <h3 class="text-uppercase fw-bold mb-4">AROUND THE WEB</h3>
                <div class="icons m-3 p-2">
                  {/* Facebook  */}
                  <i class="fa-brands fa-facebook"></i>
                  {/* Twitter  */}
                  <i class="fab fa-twitter"></i>
                  {/* LinkedIn */}
                  <i class="fab fa-linkedin-in"></i> {/* WEB */}
                  <i class="fab fa-google"></i>
                </div>
              </div>
              {/* End Of Middle */}

              <div class="col-md-4 col-lg-3 col-xl-3 mx-auto mb-md-0 mb-4">
                <h3 class="text-uppercase fw-bold mb-4">AROUND THE WEB</h3>
                <p>
                  <i class="fas fa-home me-3 text-secondary"></i> New York, NY
                  10012, US
                </p>
                <p>
                  <i class="fas fa-envelope me-3 text-secondary"></i>
                  info@example.com
                </p>
                <p>
                  <i class="fas fa-phone me-3 text-secondary"></i> + 01 234 567
                  88
                </p>
                <p>
                  <i class="fas fa-print me-3 text-secondary"></i> + 01 234 567
                  89
                </p>
              </div>
              {/* Grid column  */}
            </div>
            {/* Grid row  */}
          </div>
        </section>
        {/* Section: Links   */}

        {/* Copyright */}
        <div class="text-center p-4">
          © 2021 Copyright:
          <Link to="" class="text-reset fw-bold">
            MDBootstrap.com
          </Link>
        </div>
        {/* Copyright  */}
      </footer>
      {/* Footer  */}
    </>
  );
}

export default Footer;
